#!/usr/bin/env python3
import base64
import io
import pygame


def main():
    pygame.init()
    init_audio()
    screen = init_screen()
    game_loop(screen)


def game_loop(screen):
    running = True
    first_visible_key_absolute_index = 21
    while running:
        partially_clear(screen)

        visible_piano_black_keys, visible_piano_white_keys, visible_piano_keys = create_visible_keys(first_visible_key_absolute_index)

        partially_draw_borders(screen, visible_piano_keys)
        draw_piano_keys(screen, visible_piano_black_keys, visible_piano_white_keys)

        piano_keys_are_actual = True
        while piano_keys_are_actual:
            for event in pygame.event.get():
                handle_piano_keypress(event, screen, visible_piano_black_keys, visible_piano_white_keys, visible_piano_keys)
                if event.type == pygame.KEYDOWN:
                    if event.key == pygame.K_LEFT:
                        first_visible_key_absolute_index = max(0, first_visible_key_absolute_index - 1)
                        piano_keys_are_actual = False
                    if event.key == pygame.K_RIGHT:
                        first_visible_key_absolute_index = min(7*len(piano_octaves)-len(visible_piano_white_keys_keyboard_keys), first_visible_key_absolute_index + 1)
                        piano_keys_are_actual = False
                if event.type == pygame.QUIT: 
                    running = False

def init_audio():
    pygame.mixer.init()
    pygame.mixer.set_num_channels(100)

def init_screen():
    screen = pygame.display.set_mode((white_key_width*len(visible_piano_white_keys_keyboard_keys), 450))
    partially_clear(screen)

    pygame.display.set_caption('Piano')

    return screen

def partially_clear(screen):
    screen.fill((0x80, 0x80, 0x80))

def partially_draw_borders(screen, visible_piano_keys):
    for each_key in visible_piano_keys.values():
        each_key.partially_draw_border(screen)


def draw_piano_keys(screen, visible_piano_black_keys, visible_piano_white_keys):
    for each_white_key in visible_piano_white_keys.values():
        each_white_key.partially_draw(screen)

    for each_black_key in visible_piano_black_keys.values():
        each_black_key.partially_draw(screen)

    pygame.display.flip()


def handle_piano_keypress(event, screen, visible_piano_black_keys, visible_piano_white_keys, visible_piano_keys):
    if event.type == pygame.KEYDOWN:
        if event.key == pygame.K_ESCAPE:
            pygame.quit()
        if event.key in visible_piano_keys:
            visible_piano_keys[event.key].press()
            draw_piano_keys(screen, visible_piano_black_keys, visible_piano_white_keys)
    if event.type == pygame.KEYUP:
        if event.key in visible_piano_keys:
            visible_piano_keys[event.key].unpress()
            draw_piano_keys(screen, visible_piano_black_keys, visible_piano_white_keys)


def play(base64_encoded_sound_file_data):
    if base64_encoded_sound_file_data is None:
        return
    sound_file_data = base64.b64decode(base64_encoded_sound_file_data)
    sound_file = io.BytesIO(sound_file_data)
    sound = pygame.mixer.Sound(sound_file)
    sound.play()


class GhostPianoKeyClass:
    def __init__(self, location):
        pass
    
    def unpress(self):
        pass

    def press(self):
        pass

    def partially_draw(self, screen):
        pass

    def partially_draw_border(self, screen):
        pass


class PianoKey:
    def __init__(self, color_unpressed, size, octave, note_attribute_getter, location):
        self.border_rect = pygame.Rect(location[0], 30, size[0], size[1])
        self.rect = pygame.Rect(location[0]+1, location[1]+1, size[0]-2, size[1]-2)
        self.color_unpressed = color_unpressed
        self.color_pressed = note_attribute_getter(key_colors)
        self.current_color = color_unpressed
        self.sound = note_attribute_getter(piano_octaves[octave])
        self.letter = note_attribute_getter(key_labels)
        self.label_color = note_attribute_getter(key_label_colors)
    
    def unpress(self):
        self.current_color = self.color_unpressed

    def press(self):
        self.current_color = self.color_pressed
        play(self.sound)

    def partially_draw(self, screen):
        pygame.draw.rect(screen, self.current_color, self.rect)
        circle_loc_x = self.rect.x + self.rect.size[0]//2
        circle_loc_y = self.rect.y  + self.rect.size[1] - self.rect.size[0]//2
        pygame.draw.circle(screen, (0,0,0)           , (circle_loc_x, circle_loc_y), 22)
        pygame.draw.circle(screen, self.color_pressed, (circle_loc_x, circle_loc_y), 20)
        text = pygame.font.Font(None, 36).render(self.letter, 1, self.label_color)
        screen.blit(text, (circle_loc_x-9, circle_loc_y-10))

    def partially_draw_border(self, screen):
        pygame.draw.rect(screen, (0,0,0), self.border_rect)


white_key_width = 90
top_location = 30

def BlackPianoKey(octave, note_attribute_getter):
    return lambda left_location: PianoKey(
        (0,0,0), (60, 260), octave, note_attribute_getter, (left_location, top_location)
    )

def WhitePianoKey(octave, note_attribute_getter):
    return lambda left_location: PianoKey(
        (255, 255, 255), (white_key_width, 400), octave, note_attribute_getter, (left_location, top_location)
    )

def GhostPianoKey():
    return lambda left_location: GhostPianoKeyClass((left_location, top_location))


