def create_visible_keys(first_visible_key_absolute_index):
    visible_piano_black_keys = {
        keyboard_key : piano_key(leftmost_key_loc + 60 + white_key_width*index)
        for keyboard_key, piano_key, index in zip(visible_piano_black_keys_keyboard_keys, all_piano_black_keys[first_visible_key_absolute_index:], range(-1, len(visible_piano_black_keys_keyboard_keys)))
    }

    visible_piano_white_keys = {
        keyboard_key : piano_key(leftmost_key_loc + white_key_width*index)
        for keyboard_key, piano_key, index in zip(visible_piano_white_keys_keyboard_keys, all_piano_white_keys[first_visible_key_absolute_index:], range(len(visible_piano_white_keys_keyboard_keys)))
    }

    visible_piano_keys = visible_piano_black_keys | visible_piano_white_keys

    return visible_piano_black_keys, visible_piano_white_keys, visible_piano_keys

